window.bookSummaryJSON = "<p>What would you give up for everything? Tristan Stone was powerful, commanding, and sex incarnate. And he wore it all so well. From the moment his mesmerizing gaze met mine, I had no choice but surrender to everything he was. His power. His decadence. His passion. He was all I never knew I needed. He wanted to possess me, and I wanted to be his everything. All I had to do was accept what he offered. But everything has a price. The world he gave me fulfilled my wildest dreams, but would that be enough when the past crashed into the present? </p>"; 
